import React from 'react';
import ReactDOM from 'react-dom';
export const {Provider,Consumer} = React.createContext("默认名称");
class A extends React.Component{
  constructor(props) {
      super(props);
  }
  render () {
    let ar = [
      <h1>使用数组创建 hello world</h1>,
      <h2>使用数组创建 hello world</h2>
    ];
    return (
      <React.Fragment>
      	<Provider value={1}>
        <div>
          {ar}
        </div>
        </Provider>
      </React.Fragment>
      );
  }
}

export default A;
